INSERT INTO posts_post VALUES(1,'Pixel','pixel','','','Ã© unidade bÃ¡sica da composiÃ§Ã£o digital. Ã o sÃ­mbolo da criaÃ§Ã£o, criatividade, construÃ§Ã£o e transformaÃ§Ã£o. Se existe algo que vocÃª pode pensar, com pixels vocÃª pode criar!','is the minimal component of the visible software tecnology. It''s a creation symbol meaning creativity and transformation. Imagine something! Now pixel it and your imagination becomes real!','TXT','2021-05-07 21:38:29.254014','2021-05-07 21:38:29.254046','Pixel');
